def make_key(N=1024):
    kk = newkeys(N)
    fs = BytesIO()
    pickle.dump(kk[0],fs)
    fs.seek(0)
    pub_key = fs.read()
    fs.seek(0)
    pickle.dump(kk[1],fs)
    fs.seek(0)
    pri_key = fs.read()
    fs.close()
    return (pub_key,pri_key)
    
def encode(msg):
    global pub_key
    #fi = BytesIO(msg)
    #fo = BytesIO()
    with BytesIO(msg) as fi, BytesIO() as fo:    
        encrypt_bigfile(fi,fo,pub_key)
        fo.seek(0)
        msg=fo.read()
    return msg
    
def decode(msg):
    global pri_key
    with BytesIO(msg) as fi, BytesIO() as fo:    
        decrypt_bigfile(fi,fo,pri_key)
        fo.seek(0)
        msg=fo.read()
    return msg

